import React from 'react';

const Menu = () => {
  return (
		<div>

			<h1>Menu</h1>
      <br/> <br/>
			<h2>Burger & Cheese</h2>
			<br/>
			<h2>Creamy Mushroom</h2>
			<br/>
			<h2>Crispy Chicken</h2>
			<br/>
			<h2>Spicy Tandoori</h2>
			<br/>
			<h2>Chicken Paradise</h2>
		</div>
	);
};
  export default Menu;
